import logo from './logo.svg';
import './App.css';
import Home from './components/Home/Home';
import Friends from './components/Friends/Friends';
import About from './components/About/About';
import NotFound from './components/NotFound/NotFound';
import { BrowserRouter,Switch,Route} from 'react-router-dom';

function App() {
  return (
    <div className="App">

         <BrowserRouter>
             <Switch>
               <Route path="/home">
                    <Home></Home>
               </Route>

               <Route path="/about">
                      <About></About>
               </Route>

               <Route path="/friends">
                       <Friends></Friends>
               </Route>
                <Route exact path='/'>
                        <Home></Home>
                </Route> 
               <Route>
                        <NotFound></NotFound>
               </Route>
             </Switch>
         </BrowserRouter>

    </div>
  );
}

export default App;
